import styleCss from "./popup.module.css";
import React from 'react';
import { Modal } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom'
import { useState } from "react";
import { API } from '../config/api'

function SignUp(props) {

    const [form, setForm] = useState({
        name: "",
        email: "",
        password: ""
    })

    const { name, email, password } = form;

    const handleChange = (e) => {
        setForm({
            ...form,
            [e.target.name]: e.target.value,
        });
    };


    const navigate = useNavigate()
    const handleClick = () => {
        navigate("/home")
    }

    return (
        <Modal
            {...props}
            size="lg"
            centered
        >
            <div>
                <form className={styleCss.form}>
                    <div className={styleCss.formGroup}>
                        <h1 className={styleCss.header}>Sign Up</h1>
                        <input
                            className={styleCss.inputGroup}
                            id="fullName"
                            placeholder="Full Name"
                            type="name"
                        />

                        <input
                            className={styleCss.inputGroup1}
                            id="email"
                            placeholder="Email"
                            type="email"
                        />

                        <input
                            className={styleCss.inputGroup1}
                            id="password"
                            placeholder="Password"
                            type="password"
                        />


                        <button onClick={handleClick} className={styleCss.button} >Sign In</button>
                        <p className={styleCss.text}>Don't have an account? Klik Here</p>
                    </div>
                </form>
            </div>
        </Modal>
    );
}

export default SignUp;
